import React, { Component } from 'react';
import Paragraph from './components/Paragraph';
import Title from './components/Title';

class App extends Component {
  constructor() {
    super()
    this.state = {
      text: 'Hello World of React'
    }
  }
  render() {
    return (
      <div>
        <Title/>
        <Paragraph></Paragraph>
        <p>{this.state.text}</p>
      </div>
    );
  }
}

export default App;
